import { lazy } from "react";
import { Link } from "react-router-dom";
const SignInAdminForm = lazy(() => import("../../components/account/SignInAdminForm"));
const SignInAdminView = () => {
  const onSubmit = async (values) => {
    alert(JSON.stringify(values));
  };
  return (
    <div>
      <div className="bg-secondary border-top p-5 text-white mb-3">
            <Link to="/">
              <img alt="logo" src="../../images/(0).png" style={{ marginLeft : "150px", height: "44px", width: "159px" }} />
            </Link>
        <h1 className="display-6 text-center" style={{marginTop: "-45px"}}>Admin Sign In</h1>
      </div>
    <div className="container">
      <div className="row justify-content-center">
        <div className="col-md-5 col-sm-12">
        <div className="p-3 border" style={{ marginTop: '50px' }}>
          <SignInAdminForm onSubmit={onSubmit} />
        </div>
    </div>
    </div>
    </div>
    </div>
  );
};
export default SignInAdminView;
